in the lower dark plains, I didn&#39;t have time to slow most down or make them 
louder, but if you play them over several times, that is,  if you all have 
time, you&#39;ll see how crowed it is in the lower plains, and all these people 
waiting to get into the light or higher realms.  And guess what, like it or 
not the only light over there seems to come from, is, well, hint, it&#39;s sure 
not through Mohamed or the Buddah!  Hope you all enjoy, sf

